export const Navigation = () => {
  return (
    <div className="nav-bar">
        <div className="CommonMenu" style={{justifyContent: 'center', alignItems: 'center', gap: 7, display: 'flex'}}>
            <div className="Home">Home</div>
            <div className="About">Home</div>
            <div className="Projects">Home</div>
            <div className="Home">Home</div>

            <div className="About" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>About</div>

            <div className="Projects" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>Projects</div>

            <div className="ContactMe" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>Contact</div>
        </div>
    </div>
  );
};
